import React from "react";
import {
    HeaderWrapper, 
    Logo,
    Nav,
    NavItem,
    SearchWrapper,
    NavSearch,
    Addition,
    Button
} from "./header_style";
class Header extends React.Component{
    render(){
        return (
            <HeaderWrapper>
                <Logo></Logo>
                <Nav>
                    <NavItem className="left active">首页</NavItem>
                    <NavItem className="left">下载App</NavItem>
                    <NavItem className="right">登陆</NavItem>
                    <NavItem className="right"><span class="iconfont">&#xe636;</span></NavItem>
                    <SearchWrapper>
                        <NavSearch></NavSearch>
                        <span class="iconfont">&#xe637;</span>
                    </SearchWrapper>
                    
                </Nav>
                {/* <Addition>
                    <Button className="writing"><span class="iconfont">&#xe603;</span>写文章</Button>
                    <Button>注册</Button>
                </Addition> */}

            </HeaderWrapper>
        )
    }
}

export default Header;
